// src/components/SidePanelRight.js
import React from "react";
import "./SidePanelRight.css";
import { Home, Cloud, Circle, Moon } from "lucide-react";

function SidePanelRight({ onToggleAliens, onToggleLandings }) {
  return (
    <div className="side-panel right">
      <button title="נחיתות" onClick={onToggleLandings}>🛸</button>
      <button title="חייזרים" onClick={onToggleAliens}>👽</button>

      <button title="מקלטים">
        <Home size={24} />
      </button>
      <button title="מזג אוויר">
        <Cloud size={24} />
      </button>
      <button disabled>
        <Circle size={20} strokeWidth={1} />
      </button>
      <button disabled>
        <Circle size={20} strokeWidth={1} />
      </button>
      <button title="מצב לילה">
        <Moon size={24} />
      </button>
    </div>
  );
}

export default SidePanelRight;
